import React from 'react';
import styled from "styled-components";

const CardBlock = styled.div`
    display: inline-block;
    background-color: #F8F9FA;
`

const CardEach = styled.div`
    display: flex;
    flex-direction: column;

`

const CardPicture = styled.h1`
    content: url(${(props)=>props.imageurl});
    width: 300px;
    height: 300px;
`

const CardText = styled.p`
    background-color: white;
    font-size: 15px;
    text-align: center;
    margin-top: 10px;
`

const CardButton = styled.div`
    display: flex;
    flex-direction: row;

`



const CardButton1 = styled.button`
    

`

const CardButton2 = styled.button`
    
    
`



const Card = () => {
    return (
        <CardBlock>
            <CardEach>
                <CardPicture imageurl="https://github.com/taekeee/test/assets/129169639/81b414d3-8851-479b-a78e-5e481ad50c7e"></CardPicture>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2>
                </CardButton>
                
            </CardEach>



        </CardBlock>
    );
};

export default Card;
